INSERT INTO `movie` (`id`, `movie_name`, `movie_status`, `movie_start`, `movie_minute`, `movie_brief`, `movie_score`, `movie_money`, `movie_area`, `movie_type`, `movie_head`, `day_money`, `want_look`) VALUES (157,'哆啦A梦：伴我同行2',1,'2021-05-28 08:00:00',120,'时隔6年，动画电影“伴我同行”系列回归，同时本片也是该系列的终章。大雄为了实现奶奶看到妻子的愿望，想坐着时光机去未来参加他的婚礼，但爱情长跑50年终于要娶到静香的大雄竟然想逃婚…',9.2,106000000,'日本','剧情／动画','https://p0.meituan.net/movie/69291d617c3dc5dcac5e3bf29dda63ac2200192.jpg@218w_300h_1e_1c',1234000,0),
(158,'1921',2,'2021-07-01 08:00:00',120,'1921年的上海，租界林立，局势剑拔弩张。来自五湖四海平均年龄仅28岁的热血青年们，突破国际各股复杂势力的监控和追踪，在上海共聚，创立中国共产党。从此中国历史进入了新篇章。',0.0,1312443,'中国大陆','剧情／历史','https://p1.meituan.net/movie/63cb3dbbaff624b236b2e22b2ee59cff1553093.jpg@218w_300h_1e_1c',345133,177176),
(159,'再见，少年',2,'2021-07-01 08:00:00',120,'影片讲述了千禧年发生在南方小镇上的一段曾经无限接近，却又渐行渐远的少年情谊。“好学生”黎菲与“坏孩子”张辰浩，各自经历了时代大潮下家庭的变迁，一起奋力而坚韧地成长。然而高考前的一场剧变，让青春笼上阴影，最终裹挟住了二人的命运。',0.0,56757567,'中国大陆','青春／剧情','https://p0.meituan.net/movie/212eb488c085368630ab12fd104f52512585862.jpg@218w_300h_1e_1c',896660,115788),
(160,'人之怒',1,'2021-05-10 08:00:00',120,'在一次全副武装的运钞车劫案中，梅斯先生（杰森·斯坦森饰）的儿子作为案发目击者被劫匪杀害。怒火中烧的梅斯为报丧子之仇，化身H卧底成为运钞车安保，试图找出杀害他儿子的劫匪以及与劫匪暗中勾结的安保公司内鬼。',0.0,157000000,'中国大陆','动作','https://p0.meituan.net/moviemachine/e1178cc2abab5938c2113876da248fe0286888.jpg@218w_300h_1e_1c',756767,0),
(161,'古董局中局2',2,'2021-06-09 23:46:54',135,'来自日本的木户小姐（松峰莉璃 饰）即将向中国归还一尊唐代武则天明堂佛头，却指明要文物界权威组织“五脉”旗下白字门许家后人出面接收。但五脉白字门早已没落，许家后人也不知所踪。情势紧张，五脉掌门黄克武的孙女黄烟烟（辛芷蕾 饰）却表示，自己有办法找到许家后人的踪迹。而当初背负汉奸骂名，将佛头送去日本的白字门家主许一城之孙——许愿（雷佳音 饰），有一身鉴古天赋的他，如今只是一个胸无大志的电器铺小老板，靠倒卖电器勉强维持生计。许愿幼年时因为一场火灾失去了母亲，而父亲许和平在火灾之后便对他保持着疏离的态度，不仅如此，他还要承受着外界对自己家族的骂名——时至今日，在黄烟烟的劝说下，他不情愿的前往与五脉交涉，却敏锐地察觉到佛头是赝品的事实。',0.0,6575757,'中国大陆','剧情、逻辑','https://p0.meituan.net/movie/901384f7dfef377705548c26bcec455c2185870.jpg@218w_300h_1e_1c',12009,167398),
(162,'我要我们在一起',1,'2021-05-20 08:00:00',120,'你有没有爱过一个人，曾经拼了命，只为和TA在一起。十年前，差生吕钦扬当众告白凌一尧，两人从校园步入社会，为了让她幸福，他不惜以命相搏。然而金钱、房子、婚姻等现实的考验，却将两人越推越远。十年长跑，他们能否还记得曾经刻在心底的约定：我要我们在一起。电影改编自长帖《与我十年长跑的女友明天要嫁人了》。',8.0,272000000,'中国大陆','爱情','https://p0.meituan.net/movie/dc2fed6001e809e4553f90cc6fad9a59245170.jpg@218w_300h_1e_1c',5258000,0),
(163,'四海',2,'2022-02-01 08:00:00',120,'擅长摩托车特技的少年吴仁耀（刘昊然 饰）与他多年未见的父亲吴仁腾（沈腾 饰）再度相逢，此时女孩欢颂（刘浩存 饰）和她的哥哥的车队又意外闯入他们的生活，少年阿耀究竟收获的是朋友还是敌人，是快乐还是烦恼？他们终将名扬四海还是四海为家？北回归线上的小海岛与南方最繁华大城市的公路之旅，燃烧着他们的成长与青春。',0.0,123400,'中国大陆','喜剧／青春／动作','https://p0.meituan.net/movie/923aa8ebb795888b550b4951124682642023435.jpg@218w_300h_1e_1c',20098,17216),
(164,'指环王：王者无敌',1,'2021-05-14 08:00:00',120,'魔改编自J • R • R •托尔金的史诗巨著，在三部曲终结篇《指环王：王者无敌》中，各方势力集结，决定中土世界命运的最终决战也拉开了帷幕。光明与黑暗之间进行着激烈对决，护戒联盟的成员阿拉贡也直面身份，肩负起人皇继承人的担当与责任。然而，战胜邪恶的唯一希望仍然紧系在霍比特人弗罗多身上。为完成熔毁至尊戒这项几乎不可能完成的任务，弗罗多在忠诚的朋友山姆和可恶又可怜的咕噜的陪伴下，冒险深入黑暗之地魔多。',9.5,119000000,'中国大陆','剧情／动作／奇幻／冒险','https://p0.meituan.net/moviemachine/b183a9143031dd4aab5ca95affe410f2579878.jpg@218w_300h_1e_1c',43535435,0),
(165,'热带往事',2,'2021-06-18 08:00:00',120,'南方炎热的夏日夜晚，年轻的王学明（彭于晏饰）遭遇了一起意外。梁妈（张艾嘉饰）的老公 忽然失踪，她寻求陈警官的帮助，却不知自己已成为别人的下一个“目标”。陈警官（王砚辉饰）负责老梁 失踪案，他发现案情的发展远超自己掌控。这群不知命运已被悄然更改的人，都在试图窥视关于那个夜晚的真相，但这个夏夜的记忆如错乱的拼图，愈加扑朔迷离...',0.0,1213100,'中国大陆','剧情／犯罪／悬疑','https://p0.meituan.net/moviemachine/8db13be80574cfae05626d6df8f84c09122704.jpg@218w_300h_1e_1c',23098,27071),
