(212,'寻龙传说',1,'2021-03-05 08:00:00',120,'很久以前，在充满奇幻色彩的龙佑之邦（Kumandra),人类和龙和谐地生活在一起。但当一股邪恶的力量袭来，龙牺牲了自己来拯救人类。500年后，同样的邪恶力量卷土重来，只有一个孤独的战士拉雅（Raya）承担重任，追踪传说中的最后一条龙，以修复这块破碎的土地，团结分裂的人民。在她的旅程中，她也会逐渐了解到拯救世界不仅仅需要一条龙，还需要信任和团队合作。',9.0,127000000,'中国大陆','动画','https://p1.meituan.net/moviemachine/9be184648a639e0976887c9fd63385b36499634.jpg@218w_300h_1e_1c',345353,0),
(213,'最可爱的人',1,'2021-05-01 08:00:00',120,'1950 年，朝鲜战争爆发，战火烧到鸭绿江两岸，严重威胁到了新中国的安全。无数优秀青年，为保卫来之不易的幸福家园、保卫新中国，参加了中国人民志愿军。杨根思、邱少云、黄继光、王海、张桃芳...... 他们是普通的志愿军战士，在那场保家卫国的战争中，他们无畏强敌、英勇战斗，谱写了壮丽的生命之歌，他们是最可爱的人！',9.0,3650000,'中国大陆','战争／动画','https://p0.meituan.net/moviemachine/1049da5409a68309ecd64dc6bafd57f48879724.jpg@218w_300h_1e_1c',234489,0),
(214,'波斯语课',1,'2021-03-19 08:00:00',120,'⼆战期间，犹太⼈吉尔斯在集中营为了⽣存，谎称⾃⼰是波斯⼈，被⼀位德国军官要求教授波斯语。对波 斯语完全不懂的吉尔斯只能凭空编造出⼀门语⾔，他开始⽤集中营中关押的犹太⼈的名字作为词根，编造 出上千个“波斯语”单词。吉尔斯凭借坚强的意志和聪明的头脑，最终活了下来。',9.2,36310000,'中国大陆','剧情','https://p0.meituan.net/movie/b87e99c121df5dcb00ad6dddf61bd6ee2246726.jpg@218w_300h_1e_1c',6456453,0),
(215,'杨善洲',1,'2021-05-01 08:00:00',120,'电影《杨善洲》深情讲述了原保⼭地委书记杨善洲的故事，塑造了⼀个永远把⼈民群众利益置于个⼈利益 之前的领导⼲部形象。在任上，他狠抓农业，专注民⽣；退休后，他绿化荒⼭，造福⼦孙。他⼀⼼为民，两袖清风，鞠躬尽瘁。青⼭作证，他六⼗年坚守共产党员的精神家园，他⽤⼀⽣践⾏着⼊党时的誓⾔：做⼀个永不退休的共产党员！',9.2,83030000,'中国大陆','剧情／传记','https://p0.meituan.net/moviemachine/c4f816469681ce7c10e5c8642b124d472220970.jpg@218w_300h_1e_1c',534535,0),
(216,'离开雷锋的日子',1,'2021-05-01 08:00:00',120,'乔安山和雷锋是最亲密的好战友。在一次执行任务中，乔安山在倒车时撞倒一根木杆，砸在指挥倒车的雷锋的太阳穴上，导致雷锋受伤牺牲。乔安山后悔不已，但各级领导并没有指责他，而是保护和鼓励他像雷锋学习。退伍后，乔安山一直以雷锋为榜样，全心全意为人民服务。退休前，他陪儿子一起开最后一班车，受到了雷锋志愿者的帮助。乔安山把雷锋志愿者的帽子给儿子戴上，要他和自己一样把雷锋精神一代一代地传下去。',9.2,12333445,'中国大陆','剧情／传记','https://p0.meituan.net/moviemachine/0f0bff73e6e4f6bcdda102ecdec4b1c017415014.jpg@218w_300h_1e_1c',4654657,0),
(218,'唐人街探案',3,'2015-12-31 08:00:00',120,'影片讲述了一对表叔侄被卷入离奇黄金凶杀案，多方追捕下到处逃窜途中发生的搞笑故事。天赋异禀的结巴少年秦风（刘昊然 饰）警校落榜，被姥姥遣送泰国找远房表舅“唐人街第一神探”唐仁（王宝强 饰）散心。不想一夜花天酒地后，唐仁沦为离奇凶案嫌疑人，不得不和秦风亡命天涯…… 穷追不舍的警探黄兰登（陈赫 饰）；无敌幸运的警探坤泰（肖央 饰）；穷凶极恶、阴差阳错的“匪帮三人组”；高深莫测的“唐人街教父”等悉数登场！他们能否在躲避警察追捕、匪帮追杀、黑帮围剿的同时，在短短七天内，完成找到失落的黄金、查明真凶、为自己洗清罪名这些逆天的任务？',9.0,823000000,'中国大陆','喜剧／动作／悬疑','https://p0.meituan.net/moviemachine/905f799a205718d7ede9179b227bfcc99059007.jpg@218w_300h_1e_1c',0,0),
(219,'夏洛特烦恼',3,'2015-09-30 08:00:00',120,'在学生时代的初恋秋雅（王智饰）的婚礼上，毕业后吃软饭靠老婆养的夏洛（沈腾饰）假充大款，出尽其丑，中间还被老婆马冬梅（马丽饰）戳穿暴捶。混乱之中，夏洛意外穿越时空，回到了1997年的学生时代的课堂里。他懵懵懂懂，以为是场真实感极强的梦，于是痛揍王老师，强吻秋雅，还尝试跳楼让自己醒来。当受伤的他从病床上苏醒时，他意识到自己真的穿越了时空。既然有机会重新来过，那不如好好折腾一回。他勇敢追求秋雅、奚落优等生袁华（尹正饰）、拒绝马冬梅的死缠烂打。后来夏洛凭借“创作”朴树、窦唯等人的成名曲而进入娱乐圈。他的人生发生翻天覆地的巨变，但是内心某个地方却越来越感到空虚……',9.3,1445000000,'中国大陆','喜剧／爱情','https://p1.meituan.net/movie/43d0e1bfbda2b50d7be2b70873a87e59386692.jpg@218w_300h_1e_1c',0,0),
(220,'金钱帝国',3,'2009-04-30 08:00:00',120,'六十年代，香港警察受贿成风，赌档粉档与中间人、警方组成的利益链大肆吸金，十年内警方受贿数额达当时的百亿港币之巨。九龙城区便衣火麒麟（黄秋生 饰）为破案不择手段，上峰施压，火麒麟如常去街上拉人顶罪，大学生韩志邦（方力申 饰）遭其陷害毒打，韩母托老警员找到警方与帮会的中间人猪油仔（王晶 饰）出面搭救得脱。人称乐哥的徐乐功（梁家辉 饰）时任华人总探，为人狂妄，出手大方。陈细九（陈奕迅 饰）心地善良尤擅察言观色，深得乐哥赏识，短短五年之内由普通便衣晋升至筲箕湾区探长，但代价之一是家中为掩人耳目收留了各位大哥的九名情妇……1974年，香港的贪污恶风震动国际，廉政公署成立，长官严国梁（林保怡 饰）聘用大学生韩志邦、失意警员火麒麟等组成第一批廉政专员队伍，严厉打击香港的地下规则。陈细九因贪污案发人财两空之际，却意外的发现了此生真爱……',6.0,19300000,'中国大陆','犯罪','https://p0.meituan.net/movie/8de25a1d59f6121903d160625c0d3b2f400933.jpg@218w_300h_1e_1c',0,0),
(223,'战狼',3,'2015-04-02 08:00:00',120,'在南疆围捕贩毒分子的行动中，特种部队狙击手冷锋（吴京 饰）公然违抗上级的命令，开枪射杀伤害了战友的暴徒武吉（周晓鸥 饰）。这一行动令冷锋遭到军方禁闭甚至强制退伍的处罚，不过各特种部队精英组成超级特种部队战狼中队的中队长龙小云（余男 饰），却十分欣赏这个敢作敢为且业务过硬的血性男儿，于是将其召入自己的麾下。在新近的一次演习中，冷锋凭借冷静的判断力从老首长处拔得一城，并且成功击退了突然出现的狼群。谁知在毫无准备的情况下，战狼遭到了一伙荷枪实弹分子的袭击。原来武吉的哥哥敏登（倪大红 饰）是一个冷酷无情的国际通缉犯，他手下豢养了一大批身怀绝技的雇佣兵。为了给弟弟报仇，敏登派出雇佣兵千里迢迢奔着冷锋而来……',9.3,545000000,'中国大陆','动作／战争','https://p0.meituan.net/moviemachine/152f043cabbc6feb9153f89203872657977832.jpg@218w_300h_1e_1c',0,0),
(224,'建党伟业',3,'2011-06-15 08:00:00',120,'1911年10月10日，武昌起义掀开了中国历史新的篇章。在此之后，孙中山（马少骅 饰）回国，就任中华民国临时大总统，次年建立中华民国临时政府。然而封建王朝的没落，共和的表象下中华民族的磨难仍在继续。袁世凯（周润发 饰）篡得大总统之位，更与日本秘密签订二十一条，意在复辟帝制。在举国上下的声讨中，复辟闹剧黯然落幕，军阀混战又带来新的战火与伤痛。国难当头，爱国志士与热血青年无不痛彻心扉，义愤填膺。有的人一心效法西方先进的理念与制度，有的人尊古复礼、修缮己身。陈独秀（冯远征 饰）、李大钊（张嘉译 饰）、毛泽东（刘烨 饰）等则在十月革命的胜利中看到中华民族新的希望。这部影片讲述的，正是中国共产党诞生前夜的故事……',7.0,409000000,'中国大陆','剧情／历史','https://p0.meituan.net/movie/1dfb663bb3f2715a39a907483de97757419624.jpg@218w_300h_1e_1c',0,0),
(225,'催眠大师',3,'2014-04-29 08:00:00',120,'国内擅长催眠疗法的知名心理治疗师徐瑞宁（ 徐峥饰）正值 事业风生水起之时，由他治疗过的病人全都痊愈出院，这也使得徐瑞宁信心倍增，直至骄傲自大。就连自己的学生在课堂上对他理论的质疑，都毫不收敛的回击过去，这些都被徐瑞宁的大学老师方教授看在眼里。在徐瑞宁一次讲课后，方教授受到其学生的请求，让徐瑞宁诊断一位特殊的病人任小妍（ 莫文蔚 饰），但方教授嘱咐徐瑞宁，称这位病人的十分怪异，她看过的心理医师没有一名能够治疗她的病情，任小妍讲话虚实难辨而且懂得如何回击治疗师。方教授口中所说的这名病人，让徐瑞宁对她产生了极大的兴趣，并且自大的认为没有治不好的病人。当任小妍来到徐瑞宁的诊疗室时，徐瑞宁发现这位病患确实如同方教授 所说很有古怪。任小妍声称自己能够看到已经死去的人，并且寻求她的帮助完成生前没有做过的事，徐瑞宁听后不以为然，但任小妍解释自己根本就没有心理疾病，她所看到的都是真实存在的。徐瑞宁在任小妍一顿\\\"疯语\\\"过后，决定采用催眠疗法进行治疗。而当任小妍成功进入催眠状态后，徐瑞宁想要找出任小妍的心理阴影所在，却不曾想自己被带入了一个可怕的陷阱。',8.9,274000000,'中国大陆','剧情／惊悚／悬疑','https://p1.meituan.net/movie/abc5def22ad52058cd4664ea8f16ff641701721.jpg@218w_300h_1e_1c',0,0),
(226,'同桌的你',3,'2014-04-25 08:00:00',120,'1993年的夏天，文静秀气、戴着一副小孔眼镜的转校生周小栀（ 周冬雨饰），第一次见到了自己的同桌——坐在最后一排的捣蛋男生林一（ 林更新饰），他们一起经历了初中、高中和大学的青葱岁月。林一对周小栀爱的誓言：“总有一天，我会带你去一个只有我们俩的地方。”一晃十年 。在美国工作的林一接到国内的快件，自己初中的同桌周小栀即将结婚，于是赶回国内参加她的婚礼，在回国的飞机上，不禁回忆起两人之间的往事。1993年的夏天，文静秀气、戴着一副小孔眼镜的周小栀与林一成为同桌，两人逐渐成为朋友。在班上，周小栀经常会受到同学的欺负，都是林一出面帮助她，有好几次林一与班内的一名同学大打出手。对于林一的帮助，周小栀满怀感激，在内心里面逐渐的接受了他，转眼初中结束，周小栀和林一都升入高中。升高中之后，林一为了和周小栀一起，特地转入她的班级，在一次值日活动中，周小栀的腿摔伤了，林一义不容辞的负责接送她上下学。那一年，中国大使馆被炸，林一不顾学校的劝解，毅然上街参加示威游行。周小栀到游行现场去找林一，被学校误以为是擅自出去参加游行，两人一起受处分。林一向周小栀表示想要她做自己的女朋友，周小栀为了鼓励林一，和他约定，只要两人一起升入同一所大学，自己就会成为他的女友，林一倍受鼓舞。高考结束之后，林一升入大学，在大学里林一意外的见到了周小栀，他们都没有考入理想的大学，却又一次巧合的进了同一所大学并再一次成为同学。周小栀向他提起自己想去美国留学。林一向周小栀讲起两人之间关于高考的约定。周小栀决定兑现自己的诺言，不过她与林一约定，两人之间每天只有5分钟是恋人关系，尽管时间短暂，林一对于周小栀接受自己还是很高兴。林一的室友王尔德、龚兵以及李潇，同样希望在大学期间找一个女友。林一接到周小栀爸爸的电话，他告诉林一是周小栀故意放弃去斯坦福的机会，去他所在的大学，同时寄给了林一斯坦福大学的资料，要他转交给周小栀。林一劝说周小栀去斯坦福，周小栀告诉他，自己不想去美国，不想离开他。为了帮助周小栀实现到斯坦福留学的梦想，林一决定陪她一起去美国，于是开始发奋学习英语，他的努力让室友们感到吃惊。周小栀与林一的关系日渐紧密，周小栀把两人之间的恋人时间延长到21分钟。林一的同学Tom对周小栀很有好感，对于他主动追求周小栀的行为，林一感到很反感，两人终于爆发了冲突，林一为此受到了学校的处分、周小栀对林一不理智的行为进行了处罚，把两人相处的时间从21分钟缩减到13分钟。周小栀找到Tom告诉他自己已经有男朋友了，就是林一，至此Tom明白自己已经没有机会。周小栀和林一密切的关系，终于有一天她发现自己怀孕了，于是找到林一，将这件事情告诉了他。林一带周小栀去做人流，没有想到却引起了大出血。周小栀被送往医院，林一被怒气冲冲的小栀爸爸赶走，周小栀康复出院之后对林一没来看自己感到失望，觉得他缺乏责任心，于是提出分手，同时她终于下定决心要到美国去留学。周小栀的离开让林一感到失望，他对周小栀感情很深。这时候非典爆发了，林一成为疑似病例被隔离，周小栀对林一的境况很是牵挂。当听说隔离区里面有人患非典之后，半夜，周小栀和林一的室友通过梯子爬上了林一的宿舍，在周小栀的劝说下，林一逃离了出来，两人再一次和好。周小栀和林一商定两人一起去美国，周小栀把两人相处的恋人时间重新设定为14分钟。转眼到了毕业的时候，林一顺利的通过了面试，拿到了去美国的签证，周小栀并没有成功，林一对于自己的将来踌躇满志，他和周小栀约定，一定会在美国等她。林一到了美国之后，经过十年的打拼，没有获得理想的成功，工作收入很低，婚姻和家庭也不理想。周小栀并没有如约来到美国，林一孤身一人在美国坚持，当他收到周小栀结婚的请帖时，变得有一些竭斯底里。其实，当年周小栀把林一送走之后，由于一直没有通过考试和签证拒签，她就没有成行，林一多次联系她，周小栀表示自己不愿意去美国了，就这样两人分开。林一拿着周小栀婚礼的请帖赶到宴会现场，很多同学见面，大家一阵寒暄。周小栀和林一再次见面，看见一袭婚纱在身的周小栀，林一有一种说不出的伤感。这时候自己之前的同学过来，把他拉到包厢内，大家在一起重新聚首，都有聊不完的话题，周小栀也在座，与林一相对，相顾无言。宴会散场，林一和周小栀坐在了一起，谈及往事，周小栀告诉林一，自己多次申请去美国可是没有通过，最后只好放弃，不再去出国。而她不想把林一叫回来，也不确定他还会不会为自己回来，两人分开是最现实的事情，美好的感情最终被现实打败。周小栀的婚礼在教堂举行，林一以及别的好友们悉数出席，当两人手挽手从教堂的长廊上走过，曾经的一幕幕再一次浮现在周小栀的脑海中，可是大家都已经回不去了，人生还是要按照现实的轨道去运行。林一在现场，看着周小栀终于找到了自己的幸福，最后一丝的希望破灭，两人从同桌开始，经历的青葱岁月已经成为过去。有时候希望是美好的，可是在实现梦想的过程中，我们总是被现实打败，爱情也是如此。 其实，周小栀每次约定做林一男朋友的时间是有寓意的，5211314，即我爱你一生一世。',8.5,456000000,'中国大陆','剧情／爱情','https://p0.meituan.net/moviemachine/c0b9909be6e1cde62043dc2b54ff6159267516.jpg@218w_300h_1e_1c',0,0),
(227,'西游记之大圣归来',3,'2015-07-10 08:00:00',120,'大闹天宫后四百年多年，齐天大圣成了一个传说，在山妖横行的长安城，孤儿江流儿（林子杰 配音）与行脚僧法明（吴文伦 配音）相依为命，小小少年常常神往大闹天宫的孙悟空（张磊 配音）。 有一天，山妖（吴迪 配音）来劫掠童男童女，江流儿救了一个小女孩，惹得山妖追杀，他一路逃跑，跑进了五行山，盲打误撞地解除了孙悟空的封印。悟空自由之后只想回花果山，却无奈腕上封印未解，又欠江流儿人情，勉强地护送他回长安城。 一路上八戒（刘九容 配音）和白龙马也因缘际化地现身，但或落魄或魔性大发，英雄不再。妖王（童自荣 配音）为抢女童，布下夜店迷局，却发现悟空法力尽失，轻而易举地抓走了女童。悟空不愿再去救女童，江流儿决定自己去救。 日全食之日，在悬空寺，妖王准备将童男童女投入丹炉中，江流儿却冲进了道场，最后一战开始了……',9.3,955000000,'中国大陆','动画／动作／奇幻','https://p0.meituan.net/movie/07b4127cff2289cd91b65628f4417ac37666558.jpg@218w_300h_1e_1c',0,0),
(228,'寻龙诀',3,'2015-12-18 08:00:00',120,'20世纪80年代末， 胡八一（ 陈坤饰）、 王凯旋（ 黄渤饰）和 Shirley杨（ 舒淇饰）在美国打算金盆洗手，本来叱咤风云的摸金校尉沦为街头小贩，被移民局追得满街跑。胡八一与未婚妻Shirley移居美国想从此过上普通人的生活，谁知在婚礼前夕却发现自己二十年前死在‘百眼窟’的初恋女友 丁思甜（ 杨颖 饰）当时念念不忘的彼岸花居然再次出现！胡八一、王凯旋、Shirley杨决定再入草原千年古墓 。',9.1,1680000000,'中国大陆','动作／冒险／奇幻','https://p0.meituan.net/moviemachine/5075ae24afa597f97f5fbfefb9d2bdad478940.jpg@218w_300h_1e_1c',0,0),
(229,'倩女幽魂',3,'2011-04-30 08:00:00',120,'宁采臣 （张国荣饰）赴郭北县收帐，逢大雨，躲入传说纷纭的兰若寺投宿，但为寺内道士燕赤霞 （午马饰）所拒，于是宁采臣偷偷潜入寺中。入夜，宁采臣被一阵琴音吸引，邂逅少女聂小倩 （王祖贤饰）。聂小倩突露杀机，幸燕赤霞赶到，救下宁采臣一命。聂小倩感其正直，心生爱意，但被燕赤霞阻止。宁采臣却误认燕赤霞为杀人犯，欲与聂小倩逃走。树精姥姥 （刘兆铭饰）逼聂小倩杀宁采臣，聂小倩不肯，姥姥命众魔欲杀宁与小倩，燕赤霞再次出现，救 下二人，姥姥重伤。此时宁采臣才知聂小倩原是一游魂，因尸骨被弃荒野而受姥姥控制，每夜四处寻找壮男为姥姥吸引阳精，增益延寿。为免聂小倩再次受辱，宁采臣答应将其尸骨送回乡间安葬。不料聂小倩却被地府石妖抢去为妻。燕赤霞经不住宁采臣相求，再次出手，终于救回小倩 。',9.0,20000,'中国大陆','爱情／奇幻／武侠／古装','https://p0.meituan.net/moviemachine/e5049c64cbfadfe75c7de6ad23247a8a268159.jpg@218w_300h_1e_1c',0,0),
(230,'后会无期',3,'2014-07-24 08:00:00',120,'故事开始于虚构的中国最东边的小岛“东极岛”，智力低下的青年胡生（高华阳 饰）讲述了关于他的两个哥们儿马浩汉（冯绍峰 饰）和江河（陈柏霖 饰）的故事。浩汉在外闯荡多年后回到故乡，却发现全岛面临着拆迁问题，而他最好的朋友，岛上唯一的老师江河也将被调到更为偏远的地区。于是 浩汉做出了一个决定，那就是开车送江河去三千多公里外的学校报到。兄弟三人踏上了前所未有的旅程，途中他们见了当临时演员的童年玩伴周沫（陈乔恩 饰），误入歧途的苏米（王珞丹 饰），还有浩汉心仪多年从未见面的笔友刘莺莺（袁泉 饰），以及不羁的摩托车手阿吕（钟汉良 饰）。看似平常的旅程却暗藏伏笔，浩汉和江河最终走到了终点，开始了截然不同的人生轨迹。',8.3,629000000,'中国大陆','剧情','https://p1.meituan.net/moviemachine/9eaa0895ad341c778e0c2b135c734c6c536631.jpg@218w_300h_1e_1c',0,0),
(231,'智取威虎山',3,'2014-12-23 08:00:00',120,'全面内战时期，东北匪患横行。解放军某部剿匪小分队奔赴牡丹江，深入林海雪原，侦查员杨子荣与卫生员白茹赶来支援。为了瓦解土匪势力，杨子荣潜入土匪老窝威虎山。为了取得匪首座山雕的信任，杨子荣献出先遣图，被封为“老九”。然而狡猾多疑的座山雕还是给他设置了一系列考验，杨子荣一次次化险为夷。他在与土匪们周旋的同时，为山下的战友传递情报、组织战斗。在座山雕的寿辰“百鸡宴”上，小分队根据杨子荣的情报成功进攻威虎山并剿灭全部土匪。',9.2,883000000,'中国大陆','剧情／动作／战争／冒险','https://p0.meituan.net/movie/6a742290a13925a8add5d7fc5f3cd285431185.jpg@218w_300h_1e_1c',0,0),
(232,'寒战',3,'2012-11-08 08:00:00',120,'作为亚洲金融中心的香港被称作“最安全的城市”，岂料警局接到一通匿名电话，对方声称劫持了警队的一辆前线冲锋车以及车内的五名警员和武器装备。此次事件引起了香港警队高层的高度重视，适逢处长（王敏德 饰）出访国外，此时由鹰派人物行动副处长李文彬（梁家辉 饰）与年轻的管理副处长刘杰辉（郭富城 饰）一起负责这次案件，并将行动命名为“寒战”，李文彬任总指挥。李文彬的儿子（彭于晏 饰）也是人质之一，刘杰辉因此对李文彬父子产生怀疑。与此同时，匪徒展开了进一步行动：警察被杀、爆炸案频发……到底是谁在将整个警队玩弄于鼓掌之中？香港真的是“最安全的城市”吗？',8.3,253000000,'中国大陆','剧情／动作／犯罪','https://p1.meituan.net/moviemachine/9dad6cdbdee3747f624b455fa3950a77617969.jpg@218w_300h_1e_1c',0,0),
(233,'心花路放',3,'2014-09-30 08:00:00',120,'二手音响商耿浩（黄渤 饰）婚姻失败，他想用锤子爆小三（李晨 饰）的头，却迟迟没有勇气，幸亏在剧组做制片的兄弟郝义（徐峥 饰）及时发现自暴自弃的耿浩，他决定带着耿浩开启一段“治愈之旅”。于是一对好基友带着一只狗上路，邂逅三千公里的“桃花”。“阿凡达女郎”（陶慧 饰）、“杀马特”周丽娟（周冬雨 饰）、“白富美”（张俪 饰），各式各样的女人接连登场，耿浩一路艳遇一路疗伤。时光倒转，5年前的此时，大龄文艺女青年（袁泉 饰）因为听了一首流浪歌手耿浩的歌，毅然前往大理……在经历一连串奇葩遭遇之后，大家都放下了心里的“阴影”，找到了通向幸福的道路。',9.0,1170000000,'中国大陆','喜剧／爱情','https://p0.meituan.net/moviemachine/d40217b11e2c750a9ac298fb65f5fc0e2960128.jpg@218w_300h_1e_1c',0,0),
(234,'前任攻略',3,'2014-01-31 08:00:00',120,'在一场婚礼上新郎（关喆饰）新娘（毛俊杰饰）设置了前男友桌和前女友桌，集合了新郎的前女友们和新娘的前男友们，埋伏了两场危机四伏的相遇。婚礼上，前男友桌和前女友桌或称兄道弟，或针锋相对，或真情流露，或举杯彷徨，男人和男人，女人和女人，男人和女人之间妙语连珠、嬉笑怒骂，折射出现代人当下的爱情百态。孟云（韩庚饰）是一个生活在北京，工作上小有成就的普通青年，在这场“别开生面”的前女友婚礼上，意外结识了出现在新郎设置的“前女友桌”中的女孩夏露（姚星彤饰）。就这样，孟云和前女友的老公的前女友开始了一段猝不及防的爱情。孟云与两个大学同学余飞（郑恺饰）和罗茜（王丽坤饰）合伙运营着一家小公司，三人从大学毕业初期的艰难创业岁月中起步走到现在，关于青春，他们珍藏着关于彼此的独家记忆。然而，罗茜对孟云的感情却从青春一路跨越伴随到当下，十四年，她默默守护着孟云，而孟云也在不自知的情况下爱着罗茜。在好哥们儿余飞和夏露闺蜜小文（班嘉佳饰）的陪伴与见证下，孟云与夏露的爱情经受着历任极品前任的轮番考验，神经质般脆弱的前女友玲玲（麦迪娜饰），喝酒上瘾的前女友萌萌（熊乃瑾饰），花钱如流水的前女友尚丹（柳岩饰），还有穷的只剩钱了的夏露前男友朴恩浩（李相烨饰）都或多或少的影响到了他们的爱情，当聪明女孩夏露一一将这些状况化险为夷时，却没想到罗茜会成为无法逾越的鸿沟。罗茜与一个多金又成熟细心的男人赵明（张涵予饰）订婚了，订婚宴上，喝多了的罗茜吐露真心，而孟云也发觉了被深埋藏在自己心底的对罗茜的爱情，夏露无法面对两人的感情，从订婚宴上逃走。随后夏露与孟云在吵架时失足掉下楼梯，导致夏露流产。孟云、夏露、罗茜将怎样收拾感情的残局，众人的感情的归宿最终何去何从？',9.0,130000000,'中国大陆','喜剧／爱情','https://p0.meituan.net/moviemachine/4b792a11bf1b9f8ef20f615497b5117d2460540.jpg@218w_300h_1e_1c',0,0),
(235,'重返20岁',3,'2015-01-08 08:00:00',120,'七十岁的老太太沈梦君（归亚蕾 饰）年纪越大，脾气越大，渐渐的，除了管家李大海（王德顺 饰）还愿意留在她的身边，没有一个人愿意与她共处。在儿媳妇杨琴（李宜娟 饰）因压力过大而生病入院后，沈梦君终于被家人送入了养老院，气愤和悲伤之中，沈梦君决定在照相馆里留下自己最后的容颜，没想到却因此而开启了一段返老还童的奇幻旅程。一眨眼之间，满面皱纹的沈梦君变成了二十岁的妙龄少女孟丽君（杨子珊 饰），重获青春的沈梦君不仅体会到了年轻带来的机遇与活力，更品尝到了爱情的酸涩滋味。然而，就在她沉浸在幸福的幻觉中不能自拔之时，一场意外将她抛到了人生的十字路口之前，二十岁还是七十岁，沈梦君必须做出选择。',9.2,365000000,'中国大陆','喜剧／爱情／奇幻','https://p0.meituan.net/moviemachine/ae8f1fe730a3121eadd40969faec59c3261310.webp@218w_300h_1e_1c',12352000,0),
(236,'无间道',3,'2003-09-05 08:00:00',120,'1991年，18岁的三合会会员刘建明 （ 刘德华 饰）听从大哥韩琛 （ 曾志伟 饰）的指示进入警校学习，成为警方卧底。而同时警校中的另一名学生陈永仁 （ 梁朝伟 饰），受警方安排表面上将其强迫退学，实际上则是让他进入三合会当卧底。刘建明从警校毕业后顺利的进入警局，并且职位步步高升，已成为刑事情报科A队的一员，在此期间他利用各种机会为韩琛提供了大量的情报。而陈永仁在这些年以来已经得到了韩琛的初步信任，但由于韩琛的案件始终没有破，他永远只能呆在黑帮，只有黄警督 （ 黄秋生 饰）与他单线联系。2002年的一个晚上，根据陈永仁卧底情报，获知一批毒品即将交易，而交易的一方为韩琛，但由于当时刘建明及时将消息传给了韩琛使其成功逃脱，不过因此双方发现各自的内部俱有“内鬼”，于是一场激烈的角斗由此展开。在最后的结局中，双方“内鬼”都认出了自己的身份，不过刘建明抢先一步，已经将陈永仁在警察局的档案删除，但在删除之前，保留了一个备份，密码是女朋友Mary的生日。经过深思，刘建明决定做一个好人，请求陈永仁给他一次机会，陈永仁没有信，拷上了刘建明。最后陈永仁死在了韩琛的另一个警方卧底枪下，刘建明也杀死了那个开枪的卧底 。',9.1,20000,'中国大陆','剧情／惊悚／犯罪','https://p0.meituan.net/movie/606de8f394d40dbcbb9b87943fec71a2130408.jpg@218w_300h_1e_1c',0,0),
(238,'十二生肖',3,'2012-12-20 08:00:00',120,'当年八国联军火烧圆明园，致使大批珍贵文物流落海外，其中四尊十二生肖兽首最引人关注，不仅惹出国内外的广泛争论，更有收藏家开出天价竞拍这几尊珍品。当然，其间不乏奸邪的文物贩子，试图通过偷盗的手段获取宝贝。以此为契机，正在度假的国际大盗JC（成龙 饰）隆重登场。JC背后有一支Simon（权相宇 饰）、David（廖凡 饰）、Bonnie（张蓝心 饰）等人共同组成的超专业团队，他们一同远赴巴黎，寻求国宝鉴定专家Coco（姚星彤 饰）的帮助。经过周密细致的准备，JC等人一步步逼近重兵把守的兽首，而围绕珍宝不可避免爆发连番惊险火爆的打斗与追逐。　　在这一过程中，JC似曾被利益和金钱泯灭的爱国之心渐渐苏醒……',8.5,882000000,'中国大陆','动作／冒险／喜剧','https://p1.meituan.net/moviemachine/80480ff6eb5be5aa9f6f3bcfc68c313d1670997.jpg@218w_300h_1e_1c',0,0),
(239,'煎饼侠',3,'2015-07-17 08:00:00',120,'人气偶像大鹏（董成鹏 饰）遭遇了意外事件，令其跌入人生谷底，女友采洁（郭采洁 饰）也离他而去，只剩助理董成龙（潘斌龙 饰）和红颜知己柳岩（柳岩 饰）对他不离不弃。大鹏草率签下电影合约，却因资金问题一筹莫展，还遭到了黑道大哥王老板（梁超 饰）的威胁。无奈之下大鹏只得找来小 明星杜潇潇（袁姗姗 饰）、群头马涛（衣云鹤 饰）、狗仔摄影师胡来（崔志佳 饰）组成一个临时摄制组，准备拍摄一部全明星阵容的大片，而拍摄方式也是前所未有的尝试，邓超、吴君如、曾志伟、东北F4等一线大咖能否顺利出演？逼入绝境的大鹏将遭遇什么样的困难？',8.5,1160000000,'中国大陆','喜剧','https://p1.meituan.net/movie/99a96ba63eaea1c09fa54920efc21c41233166.jpg@218w_300h_1e_1c',0,0),
(240,'万物生长',3,'2015-04-17 08:00:00',120,'秋水（韩庚 饰），医科大学的学生，与厚朴（张博宇 饰）、黄芪（杨迪 饰）、辛夷（赵一维 饰）是死党，正值青春期的他们在旺盛荷尔蒙支配下异常生猛，不停地寻找着“猎食”对象。 含苞待放的小满（李梦 饰）是秋水念念不忘的初恋；大腿紧实的白露（齐溪 饰）是与秋水互相奉献童贞的前任；熟透了的柳青（范冰冰 饰）是秋水眼中千娇百媚的女神；胸大无脑的娟儿（沈婷婷 饰）是黄芪心中的宝贝；特异独行的魏妍（吴莫愁 饰）则是厚朴求之不得的真爱；唯独辛荑整个大学都“守身如玉”。 青春就在他们一次次荷尔蒙的释放中渐行渐远……',7.0,148000000,'中国大陆','剧情／爱情','https://p0.meituan.net/movie/c0e1d08ccfef4eb97eda8315f116d96f661997.jpg@218w_300h_1e_1c',0,0),
(241,'狄仁杰之神都龙王',3,'2013-09-28 08:00:00',120,'唐朝麟德年间，唐高宗（盛鉴 饰）与武则天（刘嘉玲 饰）强硬派出大军远征，谁知舰队在大海中遇袭，遭到重挫。该事件震惊洛阳，都城百姓狂热祭拜龙王，缭乱众生的“花魁”银睿姬（杨颖 饰）更惹来各方势力觊觎。狄仁杰（赵又廷 饰）奉武后之命调查龙王一案，偏巧卷入绑架银睿姬的案件之中。在与劫匪搏杀过程中，狄仁杰遭遇亦敌亦友的大理寺卿尉迟真金（冯绍峰 饰），遂被对方投入大牢。银睿姬一案内龙王身影再现，使洛阳上空更添一道疑云。狱中狄仁杰凭借缜密推理博取回纥医工沙陀忠（林更新 饰）的信任，逃出大牢同查龙王真相。两起案件错综复杂，相互纠缠，引向全然未知的方向……',8.3,601000000,'中国大陆','动作／悬疑／古装','https://p1.meituan.net/movie/58a7b3fc717e87bcf1172950e671a613984346.jpg@218w_300h_1e_1c',0,0),
(242,'烈日灼心',3,'2015-08-27 08:00:00',120,'七年前，福建西陇发生一起惨绝人寰的灭门惨案，某别墅内一家五口同日惨死，在社会上引起极大的震动，然而此去经年，嫌疑人杨自道（郭涛 饰）、辛小丰（邓超 饰）、陈比觉（高虎 饰）却依然逍遥法外。现如今，这三个人都在厦门过活，杨当起了出租车司机，小丰加入了协警队伍，因意外变成傻子的陈则带着三人捡来的女孩尾巴栖息在亲戚的渔场中。这一天，拥有丰富办案经验的伊谷春（段奕宏 饰）调到小丰所在的队伍担任警长。伊颇为器重能力卓越的小丰，但嗅觉灵敏的他也隐隐觉出这个男子和当年的灭门惨案有所关联。在此期间，道哥在一次意外中结识了伊的妹妹小夏（王珞丹 饰）。仿佛冥冥之中有一只看不见的手，正将这三个决心重新做人的男人推向无法更改的结局…… 本片根据须一瓜的长篇小说《太阳黑子》改编。',8.9,303000000,'中国大陆','剧情／犯罪／悬疑','https://p0.meituan.net/moviemachine/2ffaceaecd9cfffc364af17e40ae293e579394.jpg@218w_300h_1e_1c',0,0),
(243,'人在囧途',3,'2010-06-04 08:00:00',120,'大老板李成功（徐峥 饰）遇上挤奶工牛耿（王宝强 饰）之后，旅途便频出状况。被情人逼迫回长沙老家跟老婆摊牌的李成功，机场遭遇到前往长沙讨债的乌鸦嘴牛耿。牛耿人如其名，不但耿直憨厚，而且透出一股傻气。先是登机前安检一口气喝完一大罐牛奶，后来又飞机上让乘务员开窗，好不容易折腾到飞机到达长沙上空，结果让他咒得因长沙大雪飞机被迫返航。无奈挤上火车硬座车厢的李成功刚松了一口气，却又一次在人群中看到牛耿。牛耿就像李成功生命中的瘟神一样，只要他“金口一开”，便会出现如他所言的意外。由于途中的频频意外，两人从火车换乘巴士，又从巴士爬上拖拉机。尽管牛耿的乌鸦嘴让李成功吃尽苦头，但这个混身透着傻气的青年却用自己真诚与乐观感染着李成功。一路的颠簸之后，两人最终到达长沙又回到各自的生活轨迹中去，然而旅途中所遭遇的种种却影响着两人之后的生活……',8.8,37300000,'中国大陆','喜剧','https://p1.meituan.net/movie/c28bb4f8c944d5ff48592b9a636c8646351261.jpg@218w_300h_1e_1c',0,0),
(244,'赤道',3,'2015-04-30 08:00:00',120,'韩国秘密核武器神秘失踪，同时载着军方手提装置的飞机在中国境内坠毁。韩方接到消息，一名疑似绰号“赤道”的危险人物（张震 饰）带着助手“信差”（文咏珊 饰）将于香港实行秘密武器交易，韩国武器专家崔民号（池珍熙 饰）与特工朴宇哲（崔始源 饰）奉命前往调查。香港反恐特勤组主管李彦 明（张家辉 饰）与督察范家明（余文乐 饰）协助韩方寻找武器，而核物理教授肇志仁（张学友 饰）也受邀协助判案。武器很快被寻回，没想到竟还隐藏着潜在危机。正当香港及韩国警方决定送还武器回韩国之际，大陆安全局高管（王学圻 饰）带着助手袁小姐（冯文娟 饰）突然出现，三方陷入周旋之中，原来“赤道”另有其人，而他们一伙儿的阴谋也开始实施……',7.3,209000000,'中国大陆','动作／悬疑／犯罪','https://p1.meituan.net/moviemachine/d574eaa30d90e230cd2b603cc4ef9c3d3369571.jpg@218w_300h_1e_1c',0,0),
(245,'心迷宫',3,'2015-10-16 08:00:00',120,'影片讲述了一个女孩为了拴住恋人假装怀孕造成一桩命案后引发了村中一系列荒诞事件的故事。村长的儿子肖宗耀（王笑天 饰），在一次争执中失手杀死了同村的痞子白虎（朱自清 饰），被迫逃亡。同时，一个饱受家庭暴力摧残的留守女人丽琴（孙黎 饰），在曾经恋人王宝山（邵胜杰 饰）的怀抱里找到了慰藉，两人密谋杀夫。但当丽琴又一次陷入绝望，另一个男人大壮（贾致钢 饰）出现在她的生活里…正直的老村长肖卫国（霍卫民 饰）本期盼着完美的晚年生活，但却因儿子而陷入了人性的纠葛之中。',8.2,10760000,'中国大陆','剧情／悬疑／犯罪','https://p0.meituan.net/movie/5ef5b138e2165cecdea7a6eaea140c84642423.jpg@218w_300h_1e_1c',0,0),
(246,'天机·富春山居图',3,'2013-06-09 08:00:00',120,'中国元代名画《富春山居图》合璧展在即，国际黑市开出天价，日本黑帮、英伦大盗闻风而动。身陷不白之冤的国际特工肖锦汉（刘德华 饰）为证清白重出江湖，暗中执行“孙子兵法”计划；临危受命的中国人保高管林雨嫣（张静初 饰），护宝遇一波三折，困于多方势力漩涡；神秘女郎丽莎（林志玲 饰），百变魅惑，却失落真心；幕后冷血黑手小山本（佟大为 饰），嗜血如命，终落败归尘；但各怀绝技的12星座魔女（石天琦、王曼妮 等饰）为小山本作奸犯科，忠心到极致。肖锦汉为夺画上天入地钻沙漠，能否力克强敌，重现昔日特工风采？林雨嫣博弈于西子湖畔，能否与肖锦汉重归旧好？丽莎险些命丧迪拜，能否摆脱魔爪，迎来涅槃？这一场生死对决，这一段恩怨情仇，都随《富春山居图》的安然归国，迎来命定结局。',4.8,300000000,'中国大陆','动作／冒险','https://p0.meituan.net/moviemachine/6db11a0c8ceb8835873d337b96379bd67926629.jpg@218w_300h_1e_1c',0,0),
(247,'西游记之大闹天宫',3,'2014-01-31 08:00:00',120,'魔界之王牛魔王（郭富城 饰）与玉帝（周润发 饰）为首的神界展开战斗，神界被毁，女娲（张梓琳 饰）化身晶石修补天庭，遗落下的一小颗晶石落到人间成了一只石猴，而牛魔王则战败被迫带着妻子铁扇公主（陈乔恩 饰）躲到了火焰山。若干年后石猴得到了菩提老祖（海一天 饰）的教导被赐名孙悟空（甄子丹 饰），孙悟空来到花果山自立为王，还抢走了东海龙王（刘桦 饰）的定海神针当武器。同时牛魔王立志东山再起，利用了孙悟空与青梅竹马的小狐狸精（夏梓桐 饰）的感情煽动孙悟空大闹天宫，又串通了二郎神（何润东 饰）一起破坏了南天门，孙悟空势在必得，天庭危在旦夕。',5.2,1045000000,'中国大陆','动作／奇幻','https://p0.meituan.net/moviemachine/e7a642f3712fc2f4e94bb3010f6e7b607687187.jpg@218w_300h_1e_1c',0,0),
(248,'澳门风云',3,'2014-01-31 08:00:00',120,'闻名中外，曾担任美国赌场保安总顾问的魔术手石一坚（ 周润发 饰），终回流澳门退休，更宴请各方朋友到来庆祝生日宴。其中好友Benz哥奔驰（ 许绍雄 饰）与他的儿子小冷（ 谢霆锋 饰）以及外甥牛必胜牛牛（ 杜汶泽饰），更特别由香港来到澳门到贺。 翌日， 大陆、 香港以及 澳门三地警方，竟不相约而同找上石一坚，希望他可以打击对付 DOA组织集团的高先生（ 高虎 饰），但坚却以退休为由婉拒了事。而小冷同母异父的哥哥是中国公安安排在高先生的卧底，因为左眼假眼记录了洗黑钱的现场并被杀手知道是内鬼和追杀，他躲在小冷在香港的房子里时，把左眼掏出按在了一个比比熊的一只眼睛里。另一边厢，小冷竟与牛必胜一起找上门，希望坚哥收他俩为徙弟，坚哥虽欣赏小冷，但奈何已经退休，只好拒绝，但看在Benz哥份上，就招待他一夜。谁不知，当晚竟遇上了杀手（ 张晋 饰）， 杀手们不问原因直接追击小冷以及坚哥爱女阿彩（ 童菲 饰）。期间虽有中国公安洛子雯（ 景甜 饰）相救，但阿彩终难逃一劫，被害至失忆。（阿彩失忆为坚哥刻意安排为将假眼送至公安手中） 明查暗访下才知道，幕后的黑手竟是高先生。事情又岂会是无缘无故发生，坚哥与小冷二人联手，加上女公安洛子雯三人，布下 奇谋妙计对付高先生，斗智斗力，誓要查个 水落石出，将他绳之于法。',8.6,525000000,'中国大陆','喜剧／动作','https://p0.meituan.net/movie/6ff20d43b937de8a4b3521a347eff66d258341.jpg@218w_300h_1e_1c',0,0),
(249,' 二哥来了怎么办',2,'2021-06-12 08:40:10',120,'故事讲述了关于重组家庭里吵闹而又温馨的那些事。杨听风杨听雨是一对兄妹，自从杨妈妈与李叔叔再婚后，五花八门的尴尬大戏便在重组家庭中一直上演。这一天，不速之客李圣突然出现，平静的生活就此乱套……天降2哥？父母偏心？亲哥也倒戈？这一连串的巨变令杨听雨不堪忍受，只想大喊一句：2哥来了怎么办！\n',0.0,567575,'中国大陆','喜剧／剧情／青春\n','https://p1.meituan.net/movie/dbbacc79c13d4b1cee3ed4de3da19d3e3690831.jpg@464w_644h_1e_1c',23400,33082),
(250,'怒火·重案',2,'2021-07-30 12:41:56',120,'重案组布网围剿国际毒枭，突然杀出一组蒙面悍匪“黑吃黑”，更冷血屠杀众警察。重案组督察张崇邦（甄子丹饰）亲睹战友被杀，深入追查发现，悍匪首领竟是昔日战友邱刚敖（谢霆锋饰）。原来敖也曾是警队明日之星，而将敖推向罪恶深渊的人，却正是邦。宿命令二人再次纠缠，一切恩怨张崇邦如何作出了断……',0.0,5675757,'中国大陆','动作／犯罪','https://p0.meituan.net/movie/d54457e82843ea19401bfefd46f3966a2198541.jpg@464w_644h_1e_1c',12300,28232),
(251,'我没谈完的那场恋爱',2,'2021-06-25 19:43:48',120,'本片讲述了两个千差万别却同样迷茫的年轻音乐人，一个是多年打拼,事业毫无起色,又屡遭生活暴击的和声歌手珊妮,一个是身患重病,隐姓埋名等待死亡降临的前摇滚乐手董东,对生命感到绝望的二人在自我了断时相遇......自杀计划流产,他们的生活也因彼此的出现发生改变。另外一个时空的故事,从珊妮意外发现的一本1970年代的日记中铺陈开来,一段没有下文的悲伤爱情竟然在珊妮的努力下尘埃落定。跟音乐、爱情和人生有关的种种,让珊妮与董东的相遇愈发神奇。千丝万缕中,是否每一种爱都能开花结果? 他们能否找到继续爱这个世界的理由?',0.0,464564,'中国大陆','剧情／爱情／音乐','https://p1.meituan.net/movie/76b8842586867b761de63b42c2d325751523113.jpg@464w_644h_1e_1c',23900,74932),
(252,'我的青春有个你',2,'2021-09-19 20:46:12',120,'影片改编自小说《草样年华》，大一学渣邱飞（刘冬沁饰）对同级的建筑系学霸周舟（王可如饰）一见钟情，原本瞎混的邱飞找到了上学的意义，那就是和周舟在一起。两条看似不相交的线越走越近。像大部分青春一样，我们总是在不懂爱的时候遇到了最想爱的人。连续不断的意外使两人误会叠生，邱飞也被迫退学，短暂的恋爱无疾而终。十几年后，事业有成的周舟偶然看到了邱飞的摄影作品，她决定去千里之外寻找邱飞……',0.0,123124000,'中国大陆','青春／爱情','https://p1.meituan.net/movie/6f4b650661762b64d2aafb173e670c1c4279787.jpg@464w_644h_1e_1c',238900,22453),
(253,'十年一品温如言',2,'2021-10-01 19:48:17',120,'除非黄土白骨，守你百岁无忧，你是否遇见十年羁绊百年奉陪的那个人？十年前，寄养在江南水乡的温衡（任敏 饰）第一次被接回北方温家，命运的安排让她遇见了言希（丁禹兮 饰），这一遇见，便是十年纠缠。一个是低眉顺眼的温家女孩，一个是张扬跋扈的言家长孙，他们的人生道路不停交汇又分离，终于发现，两人心中所愿，不过是“永远在一起”。十年后的重逢，伴随着亲朋好友的陪伴与见证，似乎是命运的轮回，给这个“只羡温言不羡仙”的故事画上句点。',0.0,112300,'中国大陆','剧情／爱情','https://p1.meituan.net/moviemachine/e5a853698b1f13be07d1995680b9fda9264471.jpg@464w_644h_1e_1c',11223,29956),
(254,'寂静之地2',1,'2021-05-28 20:07:31',197,'寂静之地2》故事紧承上一部展开。在丈夫为保护家人牺牲后，伊芙琳（艾米莉·布朗特 饰）不得不独自带着孩子们（米莉森·西蒙斯、诺亚·尤佩 饰）面对全新的生存挑战。他们将被迫离开家园，踏上一段未知的旅途。在无声的世界里，除了要躲避“猎声怪物”的捕杀，铺满细沙的道路尽头还暗藏着新的危机。',7.7,1200000000,'中国大陆','惊悚／悬疑／剧情','https://p0.meituan.net/moviemachine/4f5ecc2cb68afdfce773914c126cb2dd146582.jpg@464w_644h_1e_1c',567685,0);
